--
-- Table structure for table `media_reactions`
--

DROP TABLE IF EXISTS `media_reactions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `media_reactions` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `media_id` int unsigned NOT NULL COMMENT 'Ссылка на медиа-файл',
  `reaction_type_id` int unsigned NOT NULL COMMENT 'Ссылка на тип реакции',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на отправителя реакции',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `fk_media_reaction_id` (`media_id`),
  KEY `fk_media_reaction_type_id` (`reaction_type_id`),
  KEY `fk_media_reaction_user` (`from_user_id`),
  CONSTRAINT `fk_media_reaction_id` FOREIGN KEY (`media_id`) REFERENCES `media` (`id`),
  CONSTRAINT `fk_media_reaction_type_id` FOREIGN KEY (`reaction_type_id`) REFERENCES `reaction_types` (`id`),
  CONSTRAINT `fk_media_reaction_user` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Таблица для хранения реакций на медиа-файлы';
/*!40101 SET character_set_client = @saved_cs_client */;

