--
-- Table structure for table `post_comments_reactions`
--

DROP TABLE IF EXISTS `post_comments_reactions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `post_comments_reactions` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `post_comment_id` int unsigned NOT NULL COMMENT 'Ссылка на комментарий',
  `reaction_type_id` int unsigned NOT NULL COMMENT 'Ссылка на тип реакции',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на отправителя реакции',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `fk_post_comment_reaction_id` (`post_comment_id`),
  KEY `fk_post_comment_reaction_type_id` (`reaction_type_id`),
  KEY `fk_post_comment_reaction_user` (`from_user_id`),
  CONSTRAINT `fk_post_comment_reaction_id` FOREIGN KEY (`post_comment_id`) REFERENCES `posts_comments` (`id`),
  CONSTRAINT `fk_post_comment_reaction_type_id` FOREIGN KEY (`reaction_type_id`) REFERENCES `reaction_types` (`id`),
  CONSTRAINT `fk_post_comment_reaction_user` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Таблица для хранения реакций на комментарии к постам';
/*!40101 SET character_set_client = @saved_cs_client */;

